import { Link } from "wouter";
import "./Header.css"
import useUser from "../hooks/useUser";

export default function Header(){

    //const isLogged = false;

    const {isLogged, logout} = useUser()

    return(
        <header className="header">
          {  isLogged? 

         <Link >
            Logout
            </Link>

         :
          <Link to="/login">
            Login 
            </Link>}
        </header>
    )
}
